import React from "react";
import Root from './Pages/Root';
import About from './Pages/About';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import './style.css';



function App() {

  const router = createBrowserRouter([
    {
      path: "/",
      element: <Root />,
    },
  ]);

  return (
    <div className="App container">
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
